        const lines = csv.trim().split('\n');
        const data = lines.slice(1).map(line => {
            const match = line.match(/^(\d+),([^,]+),(".*?"|[^,]+),(.+)$/);
            if (match) {
                return [
                    match[1],
                    match[2],
                    match[3].replace(/"/g, ''), 
                    parseFloat(match[4])
                ];
            } else {
                return line.split(',');
            }
        });

        const fechas = [...new Set(data.map(row => row[1]))];
        const departamentos = [...new Set(data.map(row => row[2]))];

        const series = departamentos.map(dep => ({
            name: dep,
            data: fechas.map(fecha => {
                const found = data.find(row => row[1] === fecha && row[2] === dep);
                return found ? found[3] : 0;
            }),
            stack: 'departamentos'
        }));

        Highcharts.chart('container', {
            chart: { type: 'area' },
            title: { text: 'Análisis de Pareto de la Demanda de Gas Natural por Departamento' },
            legend: {
            align: 'center',
            verticalAlign: 'top',
            layout: 'horizontal'},
            xAxis: {
                categories: fechas,
                title: { text: 'Fecha' },
                labels: { rotation: 45 }
            },
            yAxis: {
                min: 0,
                max: 100,
                title: { text: 'Participación (%)' ,
                        style: { fontWeight: 'bold' },
            }
            },
            tooltip: {
                shared: true,
                valueDecimals: 2,
                valueSuffix: '%'
            },
            plotOptions: {
                area: {
                    stacking: 'normal',
                    marker: { enabled: false }
                }
            },
            series: series
        });
